import getRequest from '../../../../common/api/get/getRequest';
import updateDataCategories from '../../../editProducts/utils/updateDataCategories';

const categoryPath = '/category';

async function getCategories2(setState) {
  console.log(setState);
  try {
    const response = await getRequest(categoryPath);
    const result = response.data;
    updateDataCategories(setState, { categories: result }, true);
    return result;
  } catch (error) {
    return null;
  }
}

export default getCategories2;
